import React from "react";
import '../styles/home.css';

function handleClick(gridNumber) {
    // handle click logic here
}

function Home() {
    return (
        <>
            <div>
                <header>
                    <div className='title'>
                        <img src='https://niwa.co.nz/sites/default/files/Waik_Word_RGB_H.jpg' alt="Waikato University" className='logo' />
                        <h1 className='heading'>Examiner Meeting</h1>
                    </div>
                </header>
            </div>
            <section className="hero">
                <div className="hero-content">
                    <div className="grid-container">
                        <div className="grid-item" onClick={() => handleClick(1)}>Grid 1</div>
                        <div className="grid-item" onClick={() => handleClick(2)}>Grid 2</div>
                        <div className="grid-item" onClick={() => handleClick(3)}>Grid 3</div>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Home;
